import "./App.css";
import CategoryPage from "./pages/CategoryPage";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/category/:categorySlug" element={<CategoryPage />} />

        <div className="App"></div>
      </Routes>
    </Router>
  );
}

export default App;
